import React from 'react';
import { Link } from 'react-router-dom';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

import SearchBar from './SearchBar';
import Hero from './Hero';
import ClientStories from './ClientStories';
import Contact from './Contact';
import useIntersectionObserver from './useIntersectionObserver';

const propertyTypes = [
  { name: 'Residential Land', path: '/residentialList', imageUrl: 'data:image/jpeg;base64,' }, // Replace with actual image URLs
  { name: 'Independent Flat/Villa', path: '/flatList', imageUrl: 'data:image/jpeg;base64,' }, // Replace with actual image URLs
  { name: 'Apartment', path: '/apartmentList', imageUrl: 'data:image/jpeg;base64,' } // Replace with actual image URLs
];

function Home() {
  const [headingRef, headingInView] = useIntersectionObserver({
    threshold: 0.1, // Trigger when 10% of the element is visible
  });

  return (
    <div className="p-8 mt-30">
      <Hero />
      <h1 ref={headingRef} className={`text-3xl mt-20 font-bold mb-6 text-center ${headingInView ? 'animate-fadeInDown' : ''}`}>Real Estate Listings</h1>
      <SearchBar />
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 p-6">
        {propertyTypes.map((type, index) => (
          <Link key={index} to={type.path}>
            <div className="cursor-pointer p-4 bg-white rounded-lg shadow-lg hover:shadow-xl transform hover:-translate-y-1 transition duration-300">
              <img src={type.imageUrl} alt={type.name} className="w-full h-48 object-cover rounded-t-lg" />
              <h2 className="mt-4 text-xl font-bold text-center">{type.name}</h2>
            </div>
          </Link>
        ))}
      </div>
      <div className="px-8 py-8 pz-8">
        <ClientStories />
      </div>
      <Contact />
    </div>
  );
}

export default Home;
